import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import GioHang from '../GioHang';
import TrangCaNhan from '../TrangCaNhan';
import TrangKhachHang from '../TrangKhachHang';
handleClick = event => {
    alert(event);
  }

export default function MenuBar() {
    return (
        <div>
            <Router>
                <div>
                    <nav>
                        <ul id="navigation">
                            <li><Link to="/" onClick={this.handleClick.bind(this)}>Trang chủ</Link></li>
                            <li><Link to="/GioHang">Giỏ hàng</Link></li>
                            <li><Link to="/TrangCaNhan">Trang cá nhân</Link></li>
                        </ul>
                    </nav>
                </div>
            </Router>
        </div>
    )
}
